import React, { useEffect, useState } from 'react';
import fetch from 'node-fetch'



function HomePage() {
  const [data, setData] = useState([])

  useEffect(() => {
    fetch('http://localhost:3001/users/all')
    .then(res => {
      return res.json()
    })
    .then(result => {
      setData(Array(result))
      // setData(result[0].first_name)
    })
  });

  return (
  <div>
    Welcome to Next.js!
    <div>
      { data.map(item => <div key={item.email}>{item.first_name}</div>)}
      {/* {data} */}
    </div>
  </div>
  )
}

export default HomePage
